class VizierServiceClientMeta(type):
    

    _transport_registry = OrderedDict()  
    _transport_registry["grpc"] = VizierServiceGrpcTransport
    _transport_registry["grpc_asyncio"] = VizierServiceGrpcAsyncIOTransport
    _transport_registry["rest"] = VizierServiceRestTransport
    if HAS_ASYNC_REST_DEPENDENCIES:  
        _transport_registry["rest_asyncio"] = AsyncVizierServiceRestTransport

    def get_transport_class(
        cls,
        label: Optional[str] = None,
    ) -> Type[VizierServiceTransport]:
        
        
        if (
            label == "rest_asyncio" and not HAS_ASYNC_REST_DEPENDENCIES
        ):  
            raise ASYNC_REST_EXCEPTION
        if label:
            return cls._transport_registry[label]

        
        
        return next(iter(cls._transport_registry.values()))


class VizierServiceClient(metaclass=VizierServiceClientMeta):
    

    @staticmethod
    def _get_default_mtls_endpoint(api_endpoint):
        
        if not api_endpoint:
            return api_endpoint

        mtls_endpoint_re = re.compile(
            r"(?P<name>[^.]+)(?P<mtls>\.mtls)?(?P<sandbox>\.sandbox)?(?P<googledomain>\.googleapis\.com)?"
        )

        m = mtls_endpoint_re.match(api_endpoint)
        name, mtls, sandbox, googledomain = m.groups()
        if mtls or not googledomain:
            return api_endpoint

        if sandbox:
            return api_endpoint.replace(
                "sandbox.googleapis.com", "mtls.sandbox.googleapis.com"
            )

        return api_endpoint.replace(".googleapis.com", ".mtls.googleapis.com")

    
    DEFAULT_ENDPOINT = "aiplatform.googleapis.com"
    DEFAULT_MTLS_ENDPOINT = _get_default_mtls_endpoint.__func__(  
        DEFAULT_ENDPOINT
    )

    _DEFAULT_ENDPOINT_TEMPLATE = "aiplatform.{UNIVERSE_DOMAIN}"
    _DEFAULT_UNIVERSE = "googleapis.com"

